export default (state = {}, action) => {
  switch (action.type) {
    // case 'TV_ONAIR':
    //   return [...state, ...action.payload];

    case 'TV_ONAIR':
      return { ...state, onair: action.payload };

    case 'TV_POPULAR':
      return { ...state, popular: action.payload };

    case 'TV_TOPRATED':
      return { ...state, toprated: action.payload };

    case 'SEARCH_TVS':
      return { ...state, search: action.payload };

    case 'FETCH_ACTIONADVENTURESHOW':
      return { ...state, actionadventure: action.payload };

    case 'FETCH_ANIMATIONSHOW':
      return { ...state, animation: action.payload };

    case 'FETCH_COMEDYSHOW':
      return { ...state, comedy: action.payload };

    default:
      return state;
  }
};
